    <h2 {...{
      "id": "venn-diagram"
    }}>{`Venn Diagram`}</h2>
    <p>{`A Venn Diagram is a graphical representation of logical relations
between finite sets. A rectangle depicts `}<span parentName="p" {...{
        "className": "katex"
      }}><span parentName="span" {...{
          "className": "katex-mathml"
        }}><math parentName="span" {...{
            "xmlns": "http://www.w3.org/1998/Math/MathML"
          }}><semantics parentName="math"><mrow parentName="semantics"><mi parentName="mrow" {...{
                  "mathvariant": "normal"
                }}>{``}</mi></mrow><annotation parentName="semantics" {...{
                "encoding": "application/x-tex"
              }}>{`\\Omega`}</annotation></semantics></math></span><span parentName="span" {...{
          "className": "katex-html",
          "aria-hidden": "true"
        }}><span parentName="span" {...{
            "className": "base"
          }}><span parentName="span" {...{
              "className": "strut",
              "style": {
                "height": "0.68333em",
                "verticalAlign": "0em"
              }
            }}></span><span parentName="span" {...{
              "className": "mord"
            }}>{``}</span></span></span></span>{`, which is the sample
space or the universe of discourse. The set of events are enclosed
within the rectangle and are depicted with enclosed curves, almost
always with a circle.`}</p>
    <p>{`Relation between sets are depicted by overlapping one set over another
if the sets share common elements. Otherwise, disjoint sets are depicted
separately without overlaps. Certain aspects about the relationships ---
for example the intersection --- between two sets are highlighted with
some sort of shading,`}</p>
    <p>{`The next page (which I have borrowed from MIT mathematician Andrew
Sutherlad) that follows shows beautifully, how venn diagram can
communicate various aspects about the relationship between two sets.`}</p>

